import Foods from './Foods';
import { FoodsTypeProps } from '../Interface/foodDataInterface';

export default function FoodsType(props: FoodsTypeProps ) {
  const {type, foodList} = props;

  return(
    <>
    <div>
      <div>종류 : {type}</div>
      <Foods foodsList={foodList}/>
    </div>
    </>
  )
}
